import { Link } from 'react-router-dom'
import React from "react";

const PlanetList = ({planets}) => {
  <div>
  <ul>
    {
      planets.map(p => (
        <li key={p.number}>
          <Link to={`/roster/${p.name}`}>{p.name}</Link>
        </li>
      ))
    }
  </ul>
</div>
};

export default PlanetList;
